<script type="text/javascript">
function TimeDisplay() {
  now = new Date();
  hour = now.getHours();
  min = now.getMinutes();
  sec = now.getSeconds();
    if (min <= 9) {
      min = "0" + min; }
    if (sec <= 9) {
      sec = "0" + sec; }
    if (hour < 10) {
      hour = "0" + hour; }
    document.clock.clockstyle.value = hour + ':' + min + ':' + sec;
  setTimeout("TimeDisplay()", 1000);
}
window.onload=TimeDisplay;
</script>
